('invoice_template_html', '<!doctype html>\r\n<html>\r\n<head>\r\n<meta charset=\"utf-8\">\r\n<style>\r\n  body { font-family: monospace; margin:0; padding:6px; color:#000; }\r\n  .print-area { max-width:320px; margin:0 auto; }\r\n  .center { text-align:center; }\r\n  .small { font-size:11px; }\r\n  .tiny { font-size:10px; }\r\n  .items { width:100%; border-collapse:collapse; margin-top:6px; }\r\n  .items td { padding:2px 0; vertical-align:top; }\r\n  .sep { border-top:1px dashed #000; margin:6px 0; }\r\n  .total { font-weight:bold; font-size:13px; }\r\n</style>\r\n</head>\r\n<body>\r\n<div class=\"print-area\">\r\n  <div class=\"center\">\r\n    <img src=\"{{LOGO}}\" alt=\"Logo\" style=\"max-width:160px;max-height:60px;margin-bottom:6px;\">\r\n  </div>\r\n  <div class=\"center\" style=\"font-weight:bold;font-size:14px;\">{{COMPANY_NAME}}</div>\r\n  <div class=\"center small\">NIT: {{NIT}}</div>\r\n  <div class=\"center small\">{{ADDRESS}}</div>\r\n  <div class=\"center small\">{{PHONE}}</div>\r\n  <div class=\"sep\"></div>\r\n  <div class=\"small\">Factura: <strong>{{INVOICE_NUMBER}}</strong></div>\r\n  <div class=\"small\">Fecha: {{DATE}}</div>\r\n  <div class=\"small\">Cajero: {{CASHIER}}</div>\r\n  <div class=\"small\">Cliente: {{CUSTOMER_NAME}}</div>\r\n  {{ITEMS}}\r\n  <div class=\"sep\"></div>\r\n  <div class=\"small\">Subtotal: ${{SUBTOTAL}}</div>\r\n  <div class=\"small\">IVA: ${{TAX}}</div>\r\n  <div class=\"total\">TOTAL: ${{TOTAL}}</div>\r\n  <div class=\"sep\"></div>\r\n  <div class=\"tiny\">{{LEGAL_LEGEND}}</div>\r\n</div>\r\n</body>\r\n</html>', NULL, NULL),
('invoice_template_html_branch_1', '', NULL, NULL),
('invoice_template_html_branch_2', '', NULL, NULL);
